取り出しやすいポップアップ式。クロスキルトエンボス加工。たっぷり使える１６０枚（８０組）<br><br><br>ネピア キッチンタオルボックス 160枚 80組<br>水や油をしっかり吸収するクロスキルトエンボス加工のキッチンタオルです。衛生的でおく場所を選ばず、キッチンまわりがすっきり。調理中にかんたんに取り出せて便利にお使いいただけます。クッキングからキッチンのお手入れまで幅広くお使いください。フレッシュパルプ100%製品です。蛍光染料は使用していません。ご使用済みの箱をかんたんに折りたためる機能つき。<br> 使用方法：●使い終わったボックスのたたみ方両サイドのミシン目を指で押し、上ぶたを開きます。織り込まれている内ぶたを広げます。そのまま倒すようにして折りたたみます。 使用上の注意●このキッチンタオルは水に溶けにくいので、排水口やトイレには流さないでください。<br>●引火を避けるため、火のそばにおかないでください。<br>●取り出し口のミシン目で指を傷つけることがありますのでご注意ください。 <br>原産国：日本<br><br> お問い合わせ先：王子ネピア株式会社03-3248-2769受付時間：9：30-17：00(土・日・祝日を除く)  <br>販売_製造元： 王子ネピア<br>ブランド：ネピア<br>JAN：4901121310039<br>CS：30<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
