エリエール 超吸収 キッチンタオル 4R入<br>ブランド：エリエール<br>販売・製造元：大王製紙<br><br>　<p>●濡れても破れにくい<br>●水も油もしっかり吸収<br>●電子レンジにも使用可能<br>●パルプ100％<br><br>【用途】<br>・水切り、油切り、汚れ拭きに<br><br>【原材料】<br>パルプ100％<br><br>【注意事項】<br>・つまり防止のために、流しやトイレに流さないでください。<br>・電子レンジではレンジ機能のみを使用してください。オーブン機能などでは燃える場合があります。<br>・蛍光染料は使用しておりません。<br>・可燃物です。火のそばに置かないでください。<br>・熱した油などをふき取った際には、十分にさました上でゴミとして捨ててください。</p><p><br><br> 生産国日本 <br>日用品／キッチン用品／キッチンペーパー・ふきん類／キッチンペーパー<br>JANコード： 4902011724004 <br><br>CS：12</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
